     * @dev 新しいルートを記録する関数
     * @param origin 出発地点
     * @param destination 目的地
     * @param distance 移動距離
     * @param timestamp 記録時のタイムスタンプ
     * @return uint256 新しく生成されたルートのID
     */
    function recordRoute(
        string memory origin,
        string memory destination,
        string memory distance,
        uint256 timestamp
    ) public returns (uint256) {
        _recordIds += 1;
        uint256 newRecordId = _recordIds;

        Route memory newRoute = Route({
            id: newRecordId,
            user: msg.sender,
            origin: origin,
            destination: destination,
            distance: distance,
            timestamp: timestamp,
            verified: false
        });

        routes[newRecordId] = newRoute;
        userRoutes[msg.sender].push(newRecordId);

        emit RouteRecorded(
            newRecordId,
            msg.sender,
            origin,
            destination,
            distance,
            timestamp
        );

        return newRecordId;
    }

    /**
     * @dev ルートを検証する関数（コントラクト所有者のみ実行可能）
     * @param routeId 検証するルートのID
